REPLACE INTO `noticias` (`id`, `imagen`, `titulo`, `desarrollo`, `estatus_id`, `created_at`, `updated_at`) VALUES
	(1, 'noticias/MofImhycx0kOP1J4qnoticia.png', '¡Play Ball! Inicia el Campeonato de Béisbol Menor Zamora 2024 - 2025', 'Con gran entusiasmo y un ambiente lleno de energía, este fin de semana se llevó a cabo la inauguración oficial del Campeonato de Béisbol Menor Zamora 2024. El evento, realizado en el estadio Miguel Lorenzo Garcia, reunió a niños, padres, entrenadores y aficionados que comparten la pasión por este deporte, celebrando el inicio de una nueva temporada llena de retos y emociones.  La ceremonia inaugural contó con un desfile de los equipos participantes, quienes representaron con orgullo a sus categorías y clubes. Entre aplausos y coloridas pancartas, los pequeños peloteros desfilaron luciendo sus uniformes, demostrando el espíritu de unidad y trabajo en equipo que caracteriza a esta liga.  Durante el acto protocolar, se rindió homenaje a los valores del béisbol menor: disciplina, compañerismo y esfuerzo, acompañado de emotivas palabras de bienvenida del presidente de la liga, Pablo Cruz.  El Campeonato de Béisbol Menor Zamora es un evento clave para fomentar el desarrollo deportivo en nuestra región, involucrando a jóvenes promesas del béisbol. A lo largo de esta temporada, se disputarán encuentros emocionantes en diferentes categorías, desde semillitas hasta juvenil, promoviendo el crecimiento integral de los niños a través del deporte.  La Liga de Béisbol Menor Zamora agradece el apoyo de padres, patrocinadores y la comunidad en general, quienes hacen posible la realización de este campeonato. ¡El terreno de juego ya está listo para vivir grandes momentos! ¡Que comience la acción!', 1, '2024-12-16 03:14:12', '2024-12-22 13:13:13');
